import React from "react";
import { Container, Typography, Grid, Box, Card, CardContent } from "@mui/material";

const Analysis = () => {
  return (
    <Box
      sx={{
        backgroundColor: "#f5f5f5", // Light gray background
        minHeight: "100vh",
        padding: "2rem",
      }}
    >
      <Container>
        <Typography variant="h3" align="center" gutterBottom>
          Nutritional Analysis
        </Typography>
        <Typography variant="body1" align="center" gutterBottom>
          Analyze your food and calorie intake.
        </Typography>

        <Grid container spacing={4} sx={{ mt: 3 }}>
          {/* Example Feature 1 */}
          <Grid item xs={12} md={6}>
            <Card
              sx={{
                boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
                borderRadius: "10px",
              }}
            >
              <CardContent>
                <Typography variant="h5" align="center" gutterBottom>
                  Track Your Nutrients
                </Typography>
                <Typography variant="body2" align="center">
                  Input your daily food intake and get detailed reports on macronutrients and micronutrients.
                </Typography>
              </CardContent>
            </Card>
          </Grid>

          {/* Example Feature 2 */}
          <Grid item xs={12} md={6}>
            <Card
              sx={{
                boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
                borderRadius: "10px",
              }}
            >
              <CardContent>
                <Typography variant="h5" align="center" gutterBottom>
                  Calorie Recommendations
                </Typography>
                <Typography variant="body2" align="center">
                  Get personalized calorie recommendations based on your goals and daily activity levels.
                </Typography>
              </CardContent>
            </Card>
          </Grid>
        </Grid>

        {/* Add more analysis-related cards or features here */}
      </Container>
    </Box>
  );
};

export default Analysis;
